const processReservations = (rawReservations) => {
  // Créer un nouvel objet users à partir de rawReservations
  let users = rawReservations.map(reservation => {
    return {
      key: reservation.userId,
      label: reservation.username
    };
  });

  // Éliminer les doublons
  users = users.filter((user, index, self) =>
      index === self.findIndex((t) => (
        t.key === user.key && t.label === user.label
      ))
  );

  return { rawReservations, users };
}

